import React from 'react'
import Clock from 'react-live-clock';

function Time() {
    return (
        <div style={{
            height: "50px",
            paddingTop: "10px",
            paddingBottom: "10px",
            backgroundColor: "#DCEDFF"

        }}>

            <Clock format={'dddd, MMMM Mo, YYYY, h:mm:ss A '} ticking={true} timezoom="US/Pacific" style={{
                paddingLeft: "40px"
            }}/> 
        </div>
    )
}

export default Time;
